import { IonButton, IonButtons, IonCard, IonCol, IonContent, IonGrid, IonHeader, IonIcon, IonItem, IonMenuButton, IonPage, IonRow, IonTitle, IonToolbar } from '@ionic/react';
import { add, close, pencil } from 'ionicons/icons';
import { useState, useEffect } from 'react';
import { useParams } from 'react-router';
import ExploreContainer from '../../components/ExploreContainer';


const CustomerList: React.FC = () => {

    const { name } = useParams<{ name: string; }>();

    const [clientes,setClientes] = useState<any>([]);

    useEffect(() => {
        search();
    }, []);

    const search = ()=> {
        const datosEjemplo = [
            {
                id: 1,
                firstname: 'Jero',
                lastname: 'Jimenez',
                phone: '22311451',
                email: 'jerodepiran@gmail.com',
                address: 'San Martin 190',
            },
            {
                id: 2,
                firstname: 'Eascav',
                lastname: 'axvsdv',
                phone: '22311451',
                email: 'jerojimenez17@gmail.com',
                address: 'San Martin 190',
            }
        ];
        setClientes(datosEjemplo);

    }
    return (
        <IonPage>
            <IonHeader>
                <IonToolbar>
                    <IonButtons slot="start">
                        <IonMenuButton />
                    </IonButtons>
                    <IonTitle>{name}</IonTitle>
                </IonToolbar>
            </IonHeader>

            <IonContent fullscreen>
                <IonHeader collapse="condense">
                    <IonToolbar>
                        <IonTitle size="large">{name}</IonTitle>
                    </IonToolbar>
                </IonHeader>



                <IonContent>
                    <IonCard>
                    <IonTitle>Gestion de Clientes</IonTitle>

                    <IonItem>
                        <IonButton color='primary' fill='solid' slot='end' size='default'>
                            <IonIcon icon={add}/>
                            Agregar Cliente
                        </IonButton>
                    </IonItem>

                        <IonGrid className='table'>
                            <IonRow >
                                <IonCol>Nombre</IonCol>
                                <IonCol>Email</IonCol>
                                <IonCol>Telefono</IonCol>
                                <IonCol>Direccion</IonCol>
                                <IonCol>Acciones</IonCol>
                            </IonRow>

                            {clientes.map(cliente =>

                            <IonRow>
                                <IonCol>{cliente.nom}</IonCol>
                                <IonCol>jerodepiran@gmail.com</IonCol>
                                <IonCol>2265428224</IonCol>
                                <IonCol>San Martin 511</IonCol>
                                <IonCol>
                                    <IonButton color='primary' fill='clear'>
                                        <IonIcon icon={pencil} slot='icon-only'/>
                                    </IonButton>
                                    <IonButton color='danger' fill='clear'>
                                        <IonIcon icon={close} slot='icon-only'/>
                                    </IonButton>
                                </IonCol>
                            </IonRow>
                            )}

                        </IonGrid>
                    </IonCard>
                </IonContent>





            </IonContent>
        </IonPage>
    );
};

export default CustomerList;
